// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract BridgeAssistO {
    address public owner;
    mapping(address => uint256) public entryOf;

    modifier restricted {
        require(msg.sender == owner, "This function is restricted to owner");
        _;
    }

    event WriteEntry(address indexed sender, uint256 amount);
    event Collect(address indexed sender, uint256 amount);
    event Dispense(address indexed sender, uint256 amount);
    event TransferOwnership(address indexed previousOwner, address indexed newOwner);

    function writeEntry() public payable {
        uint256 _e = entryOf[msg.sender];
        require(msg.value != _e, "Entry already contains this msg.value");
        if (_e > 0) {
            (bool _s, ) = msg.sender.call{value: _e}("");
            require(_s, "ETHO transfer failure. Contact contract owner");
        }
        entryOf[msg.sender] = msg.value;
        emit WriteEntry(msg.sender, msg.value);
    }

    function collect(address _sender) public restricted returns (uint256 amount) {
        amount = entryOf[_sender];
        require(amount != 0, "Entry is empty");
        entryOf[_sender] = 0;
        emit Collect(_sender, amount);
        return amount;
    }

    function dispense(address payable _sender, uint256 _amount) public restricted returns (bool success) {
        require(_sender.send(_amount), "ETHO transfer failure. Contact contract owner");
        emit Dispense(_sender, _amount);
        return true;
    }

    function transferOwnership(address _newOwner) public restricted {
        require(_newOwner != address(0), "Invalid address: should not be 0x0");
        owner = _newOwner;
        emit TransferOwnership(owner, _newOwner);
    }

    constructor() {
        owner = msg.sender;
    }
}
